import React from 'react'
import PropTypes from 'prop-types'
import CustomImage from '../CustomImage'

const NavabarDropdown = ({onclick}) => {

  return (
    <div className='w-auto gap-6 px-3 py-1 items-center border-indigo border rounded-full flex flex-row' onClick={onclick}>
        <div className='w-4 h-4 p-3 bg-black rounded-full '>
            <CustomImage name="userIcon" />
        </div>
        User
    </div>
  )
}

NavabarDropdown.propTypes = {
    onclick: PropTypes.func.isRequired,
}

export default NavabarDropdown
